import React from 'react'
import instagram from '../social-media-icons/instagram.svg'


export default function Footer() {
    return (
        <div style = {{display: 'flex', flexDirection: 'row', height: 200, backgroundColor: 'blue'}}>
            <img style = {{width: 50, verticalAlign: 'middle'}} src = {instagram} alt="cover photo"/>
        </div>
    )
}
